DECLARE @b VARBINARY(MAX)  --= 0x0102
DECLARE @StrBin VARCHAR(MAX)= '0x'
DECLARE @PRODS_HexRevers VARCHAR(MAX) = '' 
DECLARE @Count_PRODS INT   

SELECT @PRODS = REPLACE(@PRODS,',',';') --замена запятых
SELECT @PRODS = REPLACE(@PRODS,' ','') -- удалить пробелы
SELECT @Count_PRODS = COUNT(*) FROM dbo.zf_FilterToTable(@PRODS) --количество товаров
SELECT @PRODS_HexRevers = @PRODS_HexRevers + '04'
+SUBSTRING((REPLACE(sys.fn_varbintohexstr(cast(AValue as varbinary(4))),'0x','')),7,2) 
+SUBSTRING((REPLACE(sys.fn_varbintohexstr(cast(AValue as varbinary(4))),'0x','')),5,2) 
+SUBSTRING((REPLACE(sys.fn_varbintohexstr(cast(AValue as varbinary(4))),'0x','')),3,2) 
+SUBSTRING((REPLACE(sys.fn_varbintohexstr(cast(AValue as varbinary(4))),'0x','')),1,2) 
FROM dbo.zf_FilterToTable(@PRODS) 

IF 1=0 --для отладки
BEGIN
	SELECT LEN(@PRODS), sys.fn_varbintohexstr( cast( LEN(@PRODS) as varbinary(4) ) ) 'длина текста',
			SUBSTRING((REPLACE(sys.fn_varbintohexstr(cast(LEN(@PRODS) as varbinary(4))),'0x','')),7,2)
		   +SUBSTRING((REPLACE(sys.fn_varbintohexstr(cast(LEN(@PRODS) as varbinary(4))),'0x','')),5,2)
		   +SUBSTRING((REPLACE(sys.fn_varbintohexstr(cast(LEN(@PRODS) as varbinary(4))),'0x','')),3,2)
		   +SUBSTRING((REPLACE(sys.fn_varbintohexstr(cast(LEN(@PRODS) as varbinary(4))),'0x','')),1,2) 'длина текста'
	SELECT REPLACE(sys.fn_varbintohexstr(cast(@PRODS as varbinary(max))),'0x','')  'текст'
	SELECT @Count_PRODS Len_PRODS,case when @Count_PRODS < 128  then '02' + REPLACE(sys.fn_varbintohexstr(cast(@Count_PRODS as varbinary(1))),'0x','')												            else '03' + SUBSTRING((REPLACE(sys.fn_varbintohexstr(cast(@Count_PRODS as varbinary(2))),'0x','')),3,2)
															          + SUBSTRING((REPLACE(sys.fn_varbintohexstr(cast(@Count_PRODS as varbinary(2))),'0x','')),1,2)
															end'кол элементов'
	SELECT UPPER(@PRODS_HexRevers) 'PRODS_HexRevers'
END

--Склеить файл из составляющих в HEX виде
SELECT @StrBin = @StrBin + n FROM  (
	SELECT 'FFFFFFFF' n	UNION ALL SELECT '0001000000000A'	--длина текста	UNION ALL SELECT SUBSTRING((REPLACE(sys.fn_varbintohexstr(cast(LEN(@PRODS) as varbinary(4))),'0x','')),7,2)					 +SUBSTRING((REPLACE(sys.fn_varbintohexstr(cast(LEN(@PRODS) as varbinary(4))),'0x','')),5,2)					 +SUBSTRING((REPLACE(sys.fn_varbintohexstr(cast(LEN(@PRODS) as varbinary(4))),'0x','')),3,2)					 +SUBSTRING((REPLACE(sys.fn_varbintohexstr(cast(LEN(@PRODS) as varbinary(4))),'0x','')),1,2)	--текст	UNION ALL SELECT REPLACE(sys.fn_varbintohexstr(cast(@PRODS as varbinary(max))),'0x','')  	UNION ALL SELECT '12000000'	UNION ALL SELECT '01'	--кол элементов	UNION ALL SELECT case when @Count_PRODS < 128  then '02' + REPLACE(sys.fn_varbintohexstr(cast(@Count_PRODS as varbinary(1))),'0x','')												            else '03' + SUBSTRING((REPLACE(sys.fn_varbintohexstr(cast(@Count_PRODS as varbinary(2))),'0x','')),3,2)
															          + SUBSTRING((REPLACE(sys.fn_varbintohexstr(cast(@Count_PRODS as varbinary(2))),'0x','')),1,2)
															end   UNION ALL SELECT UPPER(@PRODS_HexRevers)) s1

--конвертировать строковую переменную в HEX виде в бинарную переменную
SET @b = CONVERT(varbinary(max),@StrBin,1)

--SELECT @b, @StrBin, len( @StrBin) -- для отладки

--Создать таблицу в которой передадим данные для бинарного файла
IF OBJECT_ID (N'dbo._test', N'U') IS NOT NULL DROP TABLE dbo._test
CREATE TABLE dbo._test (n INT, b VARBINARY(MAX))
INSERT dbo._test (n,b) VALUES (1,@b)
SELECT b FROM  dbo._test

--Создать бинарный файл
